import Logo from '../components/Logo';

const Index = () => (
  <div>
    <div className = "centered">
      <div className = "content">
        <div className = "header">
          <Logo />
        </div>
        <h2>michael c. martinez</h2>
        <p>i am a web developer currently building things with <a href="https://dialup.digital">DIAL UP Digital</a></p>
        <a href="https://github.com/harsimus">github</a>
      </div>
    </div>

    <style>
      {`
        html {
          position: relative;
          background-color: #000000;
        }

        body {
          margin: 0px !important;
          font-family: Helvetica, Arial, Sans-Serif;
          font-weight: bold;
          color: #FFFFFF;
        }

        a:link {
          color: #F39325;
          text-decoration: none;
        }

        a:hover {
          color: #E45D14;
        }

        a:visited {
          color: #961F0F;
        }

        .centered {
          position: fixed;
          top: 50%;
          left: 50%;
          transform: translate(-50%, -50%);
        }

        .header {
          position: fixed;
          top: 50%;
          left: 50%;
          transform: translate(-50%, -50%);
        }

        .content {
          text-align: justify;
          text-justify: inter-word;
        }
      `}
    </style>
  </div>
);

export default Index;
